    return (
      <section>
        <div className="headerDetails">
          <p>Botão voltar</p>
        </div>
        {console.log(this.props)}
        <div data-testid="product">
          <h3 data-testid="product-detail-name">{title}</h3>
          <h4>{id}</h4>
          <img src={thumbnail} alt={title} />
          <h4>
            {`Preço: R$ ${price}`}
          </h4>
  <p>add</p>
          <Increment />
        </div>

      </section>
    );
  }
}
